import React from 'react';

class Title extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      logo_head: "Flash Box",
      slogan: "Express Courier Services",
    };
  }
  render() {
    return (
      <div>
      <div id="logohead" className="col-12">
        <h1 className="display-3 text-center font-weight-bolder">
        {this.state.logo_head}
        </h1>
      </div>
          <h2>{this.state.slogan}</h2>
      </div>
    );
  }
}
export default Title
